import React from 'react';
import "./card.css";

const Card = () => {
    return (
		<>
			<div className='done'>
				<div className='flag'></div>
				<div className='Country'>
					<div className='units currency'></div>
					<div className='units volume'></div>
					<div className='units speed'></div>
					<div className='units distance'></div>
					<div className='units timezone'></div>
				</div>
			</div>
		</>
	);
}

export default Card;
